import styled from "styled-components";
import apple from './assets/AppleLogo.png'
import google from './assets/GooglePlaylogo.png'
import epicure from './assets/GooglePlaylogo.png'

export const EpicureImg = styled.img`width: 20%;
    height: 20%;
    margin-left:3% ;`
EpicureImg.defaultProps = {
    src: epicure,
  };

export const Appleimg = styled.img` width: 100%;
height: 100%;`
Appleimg.defaultProps = {
    src: apple,
  };

export const Googleimg = styled.img` width: 100%;
height: 100%;
margin-top: 5%;`
Googleimg.defaultProps = {
    src: google,
  };

export const Button = styled.button`width: 130px;
height: 50px;
padding-top:0%;
background-color: transparent;
border-color: transparent;`

export const Contentd = styled.div`margin-left: 2%;`

export const AboutUsContainer = styled.div` background-color: rgb(246, 245, 245);
margin-bottom: 5%;
padding-bottom: 7%;
padding-top: 5%;
margin-left:0 ;
text-align: left;`
